import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class Navbar extends Component {

    render () {
      return (
    <nav className="navbar navbar-expand-lg navbar-light border-bottom-5-custom">
  <a className="navbar-brand" href="/">Smart <span className="text-success">Farm</span></a>
  <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
    <span className="navbar-toggler-icon"></span>
  </button>
  <div className="collapse navbar-collapse" id="navbarNav">
    <ul className="nav navbar-nav ml-auto">
      <li className="nav-item active">
        <a className="nav-link" href="/">홈<span className="sr-only">(current)</span></a>
      </li>
	      <li className="nav-item">
	      <Link to={"/admin"} className="nav-link">설정</Link>
	      </li>
      <li className="nav-item">
        <a className="nav-link" href="/admin">설정</a>
      </li>
      <li className="nav-item">
        <a className="nav-link disabled" href="#"><span id="account">ID:{ this.props.account }</span></a>
      </li>
    </ul>
   </div>
   </nav>

        );
    }
}

export default Navbar;
